import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './Orders.css';

const Orders = () => {
    const [loading, setLoading] = useState(false);
    const [orders, setOrders] = useState([]);
    const [error, setError] = useState(null);

    const fetchOrders = async () => {
        setLoading(true);
        setError(null);

        try {
            // Test the base API endpoint
            await axios.get('http://localhost:5002/api/test');

            // Test the orders router
            await axios.get('http://localhost:5002/api/orders/test');

            const token = localStorage.getItem('token');
            if (!token) throw new Error('User is not authenticated.');

            const response = await axios.get('http://localhost:5002/api/orders/my-orders', {
                headers: {
                    Authorization: `Bearer ${token}`,
                    'Content-Type': 'application/json',
                },
            });

            setOrders(response.data);
        } catch (err) {
            setError(err.response?.data?.message || 'Failed to fetch orders.');
            console.error('Error fetching orders:', err);
        } finally {
            setLoading(false);
        }
    };

    useEffect(() => {
        fetchOrders();
    }, []);

    if (loading) return (
        <div className="orders-loading">
            <div className="loader"></div>
            <p>Loading your orders...</p>
        </div>
    );

    if (error) return (
        <div className="orders-error">
            <i className="error-icon">⚠️</i>
            <p>{error}</p>
        </div>
    );

    return (
        <div className="orders-container">
            <div className="orders-header">
                <h1>My Orders</h1>
                <p className="orders-subtitle">Track and manage your orders</p>
            </div>

            <div className="orders-grid">
                {orders.map(order => (
                    <div key={order._id} className="order-card">
                        <div className="order-header">
                            <div className="order-id">
                                <span className="label">Order ID:</span>
                                <span className="value">#{order._id.slice(-6)}</span>
                            </div>
                            <span className={`order-status status-${order.status}`}>
                                {order.status}
                            </span>
                        </div>

                        <div className="order-items">
                            <h3>Items Ordered</h3>
                            <ul>
                                {order.items.map(item => (
                                    <li key={item.menuItemId._id} className="order-item">
                                        <span className="item-name">{item.menuItemId.dishName}</span>
                                        <span className="item-quantity">x{item.quantity}</span>
                                    </li>
                                ))}
                            </ul>
                        </div>

                        <div className="order-footer">
                            <div className="total-amount">
                                <span className="label">Total Amount:</span>
                                <span className="value">₹{order.totalAmount}</span>
                            </div>
                            <button className="view-details-btn">View Details</button>
                        </div>
                    </div>
                ))}
            </div>

            {orders.length === 0 && (
                <div className="no-orders">
                    <i className="empty-icon">📦</i>
                    <p>You haven't placed any orders yet</p>
                </div>
            )}
        </div>
    );
};

export default Orders;
